INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020004, "ＨＰ吸収ダウン", 9, "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", 602000405);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020004, "ＴＰダウンカット", "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", 602000406);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "ダメージ減衰", 18, "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 602000501);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "ＴＰ上昇上限付与", 17, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 602000502);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "物理防御力（ダウン不可）アップ", "boss_def_lower_limit", "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", 602000503);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "魔法防御力（ダウン不可）アップ", "boss_magic_def_lower_limit", "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", 602000504);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "ＨＰ吸収ダウン", 9, "バトル開始時、すべてのキャラのＨＰ吸収を特大ダウンさせる。", 602000505);
INSERT INTO `v1_889d51f3cbfd84b485bd8f76571582386b2ff82a9f22587a13d98f01aa7395d7` VALUES (76020005, "ＴＰダウンカット", "boss_tp_down_cut", "バトル開始時、すべてのモンスターがＴＰダウン\n50％カット状態になる。", 602000506);
